import React from 'react';

const LeftBar = ({ tags, onNewItemClick }) => {
    return (
        <div style={styles.container}>
            <div style={styles.logo}>
                Power Note
            </div>
            <button onClick={onNewItemClick} style={styles.button}>
                Add New Item
            </button>
            <div style={styles.labelsContainer}>
                {tags.map((tag, index) => (
                    <div key={index} style={styles.tag}>
                        {tag}
                    </div>
                ))}
            </div>
        </div>
    );
};

const styles = {
    logo: {
        width: '100%',
        paddingBottom: '10px',
        fontSize: '20px'
    },
    container: {
        width: '100%',
        height: '100%',
        padding: '10px',
        // border: '1px solid black',
    },
    button: {
        width: '100%',
        padding: '10px',
        borderRadius: '8px',
        border: '1px solid #007BFF',
        backgroundColor: '#007BFF',
        color: '#fff',
        cursor: 'pointer'
    },
    labelsContainer: {
        display: 'flex',
        flexDirection: 'column',
        gap: '5px'
    },
    tag: {
        padding: '5px',
        borderRadius: '8px',
        border: '1px solid #ccc'
    }
};

export default LeftBar;
